    const [lentes, setLentes] = useState("");
    const [result, setResult] = useState({lentes:{esquerda: "", direita:""}});
    return(
        <Stack direction="row" spacing={1}>
            <Chip label={result.lentes.esquerda} color="primary" />
            <Chip label={result.lentes.direita} color="success" />
        </Stack>
    );
}

